" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 499px\">",
"   <div class=\"ttl\">",
"    Resectoscope metroplasty",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 479px; height: 611px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) After a Foley catheter is placed in one cavity of the complete septate uterus, the resectoscope is inserted into the opposite cavity. The septum is then incised with the resectoscope until the Foley catheter is visualized. The septum is removed in small portions until both oses are visible. (B) In a similar fashion, the septate uterus may be repaired with stepwise resectoscopic excision of the septum.",
